import React, { useEffect } from "react";
import "./AI.css";
import { Chart } from "chart.js/auto";

function AIAnalysis() {
  useEffect(() => {
    // Sentiment Analysis Graph
    const ctx1 = document.getElementById("sentimentChart").getContext("2d");
    new Chart(ctx1, {
      type: "pie",
      data: {
        labels: ["Positive", "Negative", "Neutral"],
        datasets: [
          {
            data: [40, 30, 30], // Example sentiment breakdown
            backgroundColor: ["green", "red", "orange"],
          },
        ],
      },
    });

    // Authenticity Score Graph
    const ctx2 = document.getElementById("authenticityChart").getContext("2d");
    new Chart(ctx2, {
      type: "bar",
      data: {
        labels: ["Authenticity Score"],
        datasets: [
          {
            data: [82], // Example authenticity score (82%)
            backgroundColor: ["blue"],
          },
        ],
      },
      options: {
        scales: {
          y: { beginAtZero: true, max: 100 },
        },
      },
    });
  }, []);

  return (
    <div className="analysis-container">
      {/* Header */}
      <div className="header">
        <h1>AI News Analysis Report</h1>
        <p><strong>Analyzing:</strong> <a href="https://www.ndtv.com/topic/maharashtra-protest" target="_blank" rel="noopener noreferrer">NDTV Maharashtra Protest News</a></p>
      </div>

      {/* Main Content */}
      <div className="content">
        {/* Left Column - Text Analysis */}
        <div className="left-column">
          <h2>Report Summary</h2>
          <p><strong>Title:</strong> Maharashtra Protest Sparks Controversy</p>
          <p><strong>Authenticity Score:</strong> <span className="positive">82%</span></p>
          <p><strong>Sentiment Analysis:</strong> <span className="negative">Mostly Negative</span></p>
          <p><strong>Summary:</strong> The ongoing protests in Maharashtra have led to significant political unrest, with various parties clashing over demands and governance issues.</p>
        </div>

        {/* Right Column - Graphs */}
        <div className="right-column">
          <h2>Data Analysis</h2>
          <canvas id="sentimentChart"></canvas>
          <canvas id="authenticityChart"></canvas>
        </div>
      </div>

      {/* Additional Insights */}
      <div className="highlights-box">
        <h3>Key Highlights</h3>
        <ul>
          <li>Protest intensity has risen by 60% over the last 24 hours.</li>
          <li>Major political leaders have expressed concerns over the impact.</li>
          <li>Social media is amplifying the situation with mixed reactions.</li>
        </ul>
      </div>

      <div className="impact-box">
        <h3>Potential Impact</h3>
        <p>The unrest may lead to policy changes or further escalations, depending on government response and public sentiment.</p>
      </div>

      <div className="recommendations-box">
        <h3>AI Recommendation</h3>
        <p>Monitor updates regularly and verify sources to avoid misinformation.</p>
      </div>

      {/* Footer */}
      <div className="footer">
        <p>AI Generated Report | Source: <a href="https://www.ndtv.com/topic/maharashtra-protest" target="_blank" rel="noopener noreferrer">NDTV</a></p>
      </div>
    </div>
  );
}

export default AIAnalysis;
